import React, { useEffect, useRef, useState } from 'react';
import Chart from 'chart.js/auto';
import './App.css';

const Results = () => {
  const canvasRef1 = useRef(null);
  const canvasRef2 = useRef(null);
  const [chemistryResults, setChemistryResults] = useState(null);
  const [physicsResults, setPhysicsResults] = useState(null);

  useEffect(() => {
    async function fetchData() {
      try {
        const chemistryRes = await fetch('http://localhost:5000/results/chemistry');
        const chemistryData = await chemistryRes.json();
        setChemistryResults(chemistryData);

        const physicsRes = await fetch('http://localhost:5000/results/physics');
        const physicsData = await physicsRes.json();
        setPhysicsResults(physicsData);

        const chemistryChartData = {
          labels: ['Obtained Marks'],
          datasets: [
            {
              data: [chemistryData.obtainedMarks],
              backgroundColor: ['#36a2eb'],
            },
          ],
        };

        const chemistryPercentageData = {
          labels: ['This much you are skillful', 'This much you are lacking'],
          datasets: [
            {
              data: [chemistryData.percentage, 100 - chemistryData.percentage],
              backgroundColor: ['#36a2eb', '#ebed36'],
            },
          ],
        };

        const physicsChartData = {
          labels: ['Obtained Marks'],
          datasets: [
            {
              data: [physicsData.obtainedMarks],
              backgroundColor: ['#36a2eb'],
            },
          ],
        };

        const physicsPercentageData = {
          labels: ['This much you are skillful', 'This much you are lacking'],
          datasets: [
            {
              data: [physicsData.percentage, 100 - physicsData.percentage],
              backgroundColor: ['#36a2eb', '#ebed36'],
            },
          ],
        };

        // Create doughnut chart for percentage of chemistry
        const chemistryPercentageChart = new Chart(document.getElementById('chemistryPercentageChart'), {
          type: 'doughnut',
          data: chemistryPercentageData,
          options: {
            plugins: {
              legend: {
                position: 'bottom',
              },
            },
          },
        });

        // Create bar chart for chemistry results
        const chemistryResultsChart = new Chart(canvasRef2.current, {
          type: 'bar',
          data: chemistryChartData,
          options: {
            scales: {
              y: {
                beginAtZero: true,
                max: chemistryData.totalMarks,
              },
            },
            plugins: {
              legend: {
                display: false,
              },
            },
          },
        });

        // Create doughnut chart for percentage of physics
        const physicsPercentageChart = new Chart(document.getElementById('physicsPercentageChart'), {
          type: 'doughnut',
          data: physicsPercentageData,
          options: {
            plugins: {
              legend: {
                position: 'bottom',
              },
            },
          },
        });

        // Create bar chart for physics results
        const physicsResultsChart = new Chart(canvasRef1.current, {
          type: 'bar',
          data: physicsChartData,
          options: {
            scales: {
              y: {
                beginAtZero: true,
                max: physicsData.totalMarks,
              },
            },
            plugins: {
              legend: {
                display: false,
              },
            },
          },
        });

        return () => {
          // Destroy charts on unmount
          chemistryResultsChart.destroy();
          chemistryPercentageChart.destroy();
          physicsResultsChart.destroy();
          physicsPercentageChart.destroy();
        };
      } catch (err) {
        console.error(err);
      }
    }

    fetchData();
  }, []);
  return (
    <div>
      <h2>Chemistry Results</h2>
      {chemistryResults && (
        <div className="results-container">
          <div className="chart-container">
            <canvas ref={canvasRef2} />
          </div>
          <div className="percentage-container">
            <canvas id="chemistryPercentageChart" />
          </div>
          <div className="stats-container">
            <p>Obtained Marks: {chemistryResults.obtainedMarks}</p>
            <p>Total Marks: {chemistryResults.totalMarks}</p>
            <p>Percentage: {chemistryResults.percentage.toFixed(2)}%</p>
          </div>
        </div>
      )}

      <h2>Physics Results</h2>
      {physicsResults && (
        <div className="results-container">
          <div className="chart-container">
            <canvas ref={canvasRef1} />
          </div>
          <div className="percentage-container">
            <canvas id="physicsPercentageChart" />
          </div>
          <div className="stats-container">
            <p>Obtained Marks: {physicsResults.obtainedMarks}</p>
            <p>Total Marks: {physicsResults.totalMarks}</p>
            <p>Percentage: {physicsResults.percentage.toFixed(2)}%</p>
          </div>
        </div>
      )}

      {chemistryResults && physicsResults && (
        <>
          <Chart
            type="bar"
            data={{
              labels: ['Chemistry', 'Physics'],
              datasets: [
                {
                  label: 'Obtained Marks',
                  data: [chemistryResults.obtainedMarks, physicsResults.obtainedMarks],
                  backgroundColor: ['#36a2eb', '#ff6384'],
                },
              ],
            }}
            options={{
              scales: {
                y: {
                  beginAtZero: true,
                  max: Math.max(chemistryResults.totalMarks, physicsResults.totalMarks),
                },
              },
              plugins: {
                legend: {
                  display: false,
                },
              },
            }}
          />

          <Chart
            type="doughnut"
            data={{
              labels: ['Chemistry', 'Physics'],
              datasets: [
                {
                  label: 'Skill Level',
                  data: [chemistryResults.percentage, physicsResults.percentage],
                  backgroundColor: ['#36a2eb', '#ff6384'],
                },
              ],
            }}
            options={{
              plugins: {
                legend: {
                  position: 'bottom',
                },
              },
            }}
          />
        </>
      )}
    </div>
  );
};

export default Results;
